export default {
  name: 'page',
  props: {
    pageModel: {}
  },
  methods: {
    //每页条数变化事件
    handleSizeChange(val) {
      this.pageModel.rows = val
      this.$emit("selectList");
    },
    //页数变化事件
    pageChange(val) {
      this.pageModel.page = val
      this.$emit("selectList");
    },
  }
}
